amp><champ>mot_20</champ><champ>mot_21</champ><champ>mot_22</champ><champ>mot_23</champ><champ>mot_24</champ><champ>mot_25</champ><champ>mot_26</champ><champ>mot_27</champ><champ>mot_4</champ><champ>mot_5</champ><champ>mot_6</champ><champ>mot_7</champ><champ>mot_9</champ><champ>ligne_1</champ></champs><donnee><date>2008-05-15 09:51:38</date><maj>2008-05-15 09:51:38</maj><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur>Bat test</valeur></donnee></donnees></article><rubrique id="4564" idParent="4563">Cabine principale<motclef/><article id="1792">Cabine principale<date>2008-05-15 09:52:05</date><maj>2008-05-15 09:52:18</maj><auteur>6</auteur><donnees><grille>65</grille><champs><champ>ligne_2</champ><champ>ligne_3</champ><champ>ligne_1</champ><champ>select_1</champ><champ>select_2</champ></champs><donnee><date>2008-05-15 09:52:05</date><maj>2008-05-15 09:52:05</maj><valeur/><valeur/><valeur>Cabine principale</valeur><valeur>select_1_3</valeur><valeur>select_2_1</valeur></donnee></donnees></article><rubrique id="4565" idParent="4564">Cabine ascenseur 15/05/08 - 09:52:18<motclef>125</motclef><article id="1793">Cabine ascenseur 15/05/08 - 09:52:18<date>2008-05-15 09:52:18</date><maj>2008-05-15 09:52:18</maj><auteur>6</auteur><donnees><grille>59</grille><champs><champ>ligne_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-15 09:52:18</date><maj>2008-05-15 09:52:18</maj><valeur>Les commandes int&#xE9;rieures sont situ&#xE9;es sur le c&#xF4;t&#xE9; de la cabine ; &#xE0; droite (ouverture centrale) ou du c&#xF4;t&#xE9; de fermeture de la porte (si l''ascenseur est inf&#xE9;rieur &#xE0; 200 x 140 cm)</valeur><valeur>cr_asc_cab_01</v