libre inf &#xE0; 220 cm de hauteur, alors ils sont rappel&#xE9;s par un &#xE9;l&#xE9;ment bas install&#xE9; au max &#xE0; 40 cm du sol ou par une sur&#xE9;paisseur au sol d''au moins 3 cm</valeur><valeur>cr_voirie_chem_05</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Pr&#xE9;sence d''un guide tactilement et visuellement constrat&#xE9; le long du cheminement</valeur><valeur>cr_voirie_chem_06</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>La largeur du cheminement est &gt;= &#xE0; 140 cm sans obstacle</valeur><valeur>cr_voirie_chem_07</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si absence de murs et d''obstacles de part et d''autre du cheminement alors sa largeur est &gt;= &#xE0; 120 cm</valeur><valeur>cr_voirie_chem_08</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Le devers est inf&#xE9;rieur ou &#xE9;gal &#xE0; 2%</valeur><valeur>cr_voirie_chem_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Pente inf&#xE9;rieure &#xE0; 5%</valeur><valeur>cr_voirie_chem_10</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si impossibilit&#xE9; technique alors pente inf&#xE9;rieure &#xE0; 8% sur une distance inf&#xE9;rieure ou &#xE9;gale &#xE0; 2 m</valeur><valeur>cr_voirie_chem_11</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si impossibilit&#xE9; technique alors pente inf&#xE9;rieure &#xE0; 12% sur une distance inf&#xE9;rieure ou &#xE9;gale &#xE0; 50 cm</valeur><valeur>cr_voirie_chem_12</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si pente s