/valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Un palier de repos pr&#xE9;sent &#xE0; chaque bifurcation du cheminement poss&#xE8;de un espace de manoeuvre de 200 cm de diam&#xE8;tre</valeur><valeur>cr_voirie_chem_20</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si rupture de niveau de plus de 40 cm alors garde-corps le long de la rupture de niveau</valeur><valeur>cr_voirie_chem_21</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Le garde au corps est contrast&#xE9; par rapport &#xE0; l''environnement, plein et continu jusqu''au sol</valeur><valeur>cr_voirie_chem_22</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Un ressaut est inf&#xE9;rieure ou &#xE9;gal &#xE0; 2 cm</valeur><valeur>cr_voirie_chem_23</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Un ressaut est inf&#xE9;rieur ou &#xE9;gal &#xE0; 4 cm si il est en chanfrein &#xE0; 1/3</valeur><valeur>cr_voirie_chem_24</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:24</date><maj>2008-05-06 10:15:24</maj><valeur>La distance entre 2 ressauts est inf&#xE9;rieure ou &#xE9;gale &#xE0; 250 cm</valeur><valeur>cr_voirie_chem_25</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:24</date><maj>2008-05-06 10:15:24</maj><valeur>Absence de pente &#xE0; ''pas d''&#xE2;ne'' </valeur><valeur>cr_voirie_chem_26</valeur><valeur>124</valeur></donnee></donnees></article><article id="1829" idRub="4595">cr_voirie_chem_04 6/05/08 - 10:15:43<date>2008-05-06 10:15:43</date><maj>2008-05-21 10:09:54</maj><auteur>6</auteur><donnees><grille>60</grille><champs><champ>ligne_3</champ><champ>ligne_1</champ><champ>ligne_2</champ><champ>mot_1</champ><champ>texte_1</champ><champ>ligne