s><grille>35</grille><champs><champ>ligne_1</champ><champ>ligne_2</champ><champ>mot_1</champ><champ>select_1</champ></champs><donnee><date>2008-05-21 10:31:50</date><maj>2008-05-21 10:31:50</maj><valeur/><valeur/><valeur/><valeur/></donnee></donnees></article><rubrique id="4570" idParent="4569" idAdmin="">EspaceInt Sans Nom 21/05/08 - 10:33:26<motclef/><article id="1801" idRub="4570">EspaceInt Sans Nom 21/05/08 - 10:33:26<date>2008-05-21 10:33:26</date><maj>2008-05-21 10:33:26</maj><auteur>6</auteur><donnees><grille>57</grille><champs><champ>ligne_1</champ><champ>ligne_2</champ><champ>ligne_3</champ><champ>select_1</champ><champ>select_2</champ></champs><donnee><date>2008-05-21 10:33:26</date><maj>2008-05-21 10:33:26</maj><valeur/><valeur/><valeur/><valeur/><valeur/></donnee></donnees></article><rubrique id="4572" idParent="4570" idAdmin="">Commandes<motclef>42</motclef><article id="1803" idRub="4572">Commandes<date>2008-05-21 10:33:31</date><maj>2008-05-21 10:33:31</maj><auteur>6</auteur><donnees><grille>59</grille><champs><champ>ligne_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-21 10:33:31</date><maj>2008-05-21 10:33:31</maj><valeur>Lorsque plusieurs &#xE9;quipements ou mobiliers ont la m&#xEA;me fonction, un au moins est rep&#xE9;rable, atteignable et utilisable</valeur><valeur>cr_dis_com_01</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:31</date><maj>2008-05-21 10:33:31</maj><valeur>C''est le dispositif adapt&#xE9; qui est prioritairement ouvert</valeur><valeur>cr_dis_com_02</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:32</date><maj>2008-05-21 10:33:32</maj><valeur>L''&#xE9;quipement, le mobilier est rep&#xE9;rable par un &#xE9;clairage particulier ou un contraste visuel</valeur><valeur>cr_dis_com_03</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:32</date><maj>2008-05-21 10:33:32</maj><valeur>L''&#xE9;quipement, le mobilier poss&#xE8;de un espace d''usage est de 80 x 130 cm au droit de l''&#xE9;quipement</valeur><valeur>cr_dis_com_04</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:32</date><maj>2008-05-21 10:33:32</maj><valeur>L''&#xE9;quipement, le mobilier est utilisable en position ''assis''</valeur><valeur>cr_dis_com_05</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:33</date><maj>2008-05-21 10:33:33</maj><valeur>Dans le cas de lavabos ou des guichets d''informations, de vente manuelle et de service qui n&#xE9;cessitent de ''lire, &#xE9;crire, utiliser un clavier'', il est atteignable et utilisable en position ''assis'' parce qu''il est &#xE0; une hauteur maximale de 80 cm</valeur><valeur>cr_dis_com_06</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:33</date><maj>2008-05-21 10:33:33</maj><valeur>Dans le cas de lavabos, de guichets d''informations ou de vente manuelle et de service qui requiert la n&#xE9;cessit&#xE9; de ''lire, &#xE9;crire, utiliser un clavier'', il est est atteignable et utilisable en position ''assis'' parce qu''il d&#xE9;gage un vide de 30 cm de profondeur</valeur><valeur>cr_dis_com_07</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:33</date><maj>2008-05-21 10:33:33</maj><valeur>Dans le cas de lavabos ou des guichets d''informations, de vente manuelle et de service qui n&#xE9;cessitent de ''lire, &#xE9;crire, utiliser un clavier'', il est est atteignable et utilisable en position ''assis'' parce qu''il d&#xE9;gage un vide de 60 cm de large</valeur><valeur>cr_dis_com_08</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:34</date><maj>2008-05-21 10:33:34</maj><valeur>Dans le cas de lavabos ou des guichets d''informations, de vente manuelle et de service qui n&#xE9;cessitent de ''lire, &#xE9;crire, utiliser un clavier'', il est est atteignable et utilisable en position ''assis'' parce qu''il d&#xE9;gage un vide de 70 cm de hauteur</valeur><valeur>cr_dis_com_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:34</date><maj>2008-05-21 10:33:34</maj><valeur>L''&#xE9;quipement, le mobilier est atteignable en position ''debout''</valeur><valeur>cr_dis_com_10</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:34</date><maj>2008-05-21 10:33:34</maj><valeur>L''&#xE9;quipement, le mobilier est utilisable en position ''debout''</valeur><valeur>cr_dis_com_11</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:35</date><maj>2008-05-21 10:33:35</maj><valeur>L''&#xE9;quipement, le mobilier qui n&#xE9;cessite ''de voir, d''entendre ou parler'' est situ&#xE9; &#xE0; une hauteur comprise entre 90 et 130 cm</valeur><valeur>cr_dis_com_12</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:35</date><maj>2008-05-21 10:33:35</maj><valeur>L''&#xE9;quipement, le mobilier ne cr&#xE9;e pas d''obstacle &#xE0; la personne d&#xE9;ficiente visuelle</valeur><valeur>cr_dis_com_13</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:35</date><maj>2008-05-21 10:33:35</maj><valeur>Le dispositif de commande et de service est rep&#xE9;rable par un &#xE9;clairage particulier ou un contraste visuel</valeur><valeur>cr_dis_com_14</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:36</date><maj>2008-05-21 10:33:36</maj><valeur>Le dispositif de commande et de service poss&#xE8;de un espace d''usage de 80 &#xD7; 130 cm</valeur><valeur>cr_dis_com_15</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:36</date><maj>2008-05-21 10:33:36</maj><valeur>Le dispositif de commande et de service est utilisable en position ''assis''</valeur><valeur>cr_dis_com_16</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:36</date><maj>2008-05-21 10:33:36</maj><valeur>Le dispositif de commande et de service est utilisable en position ''debout''</valeur><valeur>cr_dis_com_17</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:36</date><maj>2008-05-21 10:33:36</maj><valeur>Les dispositifs de commande et de service manuels ainsi que ceux qui n&#xE9;cessite ''de voir, d''entendre ou parler'' ou les dispositifs li&#xE9;s &#xE0; la s&#xE9;curit&#xE9; ont une hauteur comprise entre 90 et 130 cm</valeur><valeur>cr_dis_com_18</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:37</date><maj>2008-05-21 10:33:37</maj><valeur>Le dispositif de commande et de service ne cr&#xE9;e pas d''obstacle &#xE0; la personne d&#xE9;ficiente visuelle</valeur><valeur>cr_dis_com_19</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:37</date><maj>2008-05-21 10:33:37</maj><valeur>Pr&#xE9;sence d''un ergot en relief sur les dispositifs de commande</valeur><valeur>cr_dis_com_20</valeur><valeur>124</valeur></donnee></donnees></article></rubrique><rubrique id="4571" idParent="4570" idAdmin="">Eclairage<motclef>43</motclef><article id="1802" idRub="4571">Eclairage<date>2008-05-21 10:33:27</date><maj>2008-05-21 10:33:27</maj><auteur>6</auteur><donnees><grille>59</grille><champs><champ>ligne_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-21 10:33:27</date><maj>2008-05-21 10:33:27</maj><valeur>L''&#xE9;clairage artificiel ou naturel n''est pas une g&#xEA;ne pour une personne en position &#xAB; debout &#xBB;</valeur><valeur>cr_lux_01</valeur><valeur>2</valeur></donnee><donnee><date>2008-05-21 10:33:28</date><maj>2008-05-21 10:33:28</maj><valeur>L''&#xE9;clairage artificiel ou naturel n''est pas une g&#xEA;ne pour une personne en position &#xAB; assis &#xBB;</valeur><valeur>cr_lux_02</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:28</date><maj>2008-05-21 10:33:28</maj><valeur>La qualit&#xE9; d''&#xE9;clairage est renforc&#xE9;e pour les dispositifs d''acc&#xE8;s</valeur><valeur>cr_lux_03</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:28</date><maj>2008-05-21 10:33:28</maj><valeur>La qualit&#xE9; d''&#xE9;clairage est renforc&#xE9;e pour la signal&#xE9;tique</valeur><valeur>cr_lux_04</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:28</date><maj>2008-05-21 10:33:28</maj><valeur>Si l''&#xE9;clairage poss&#xE8;de une temporisation, alors l''extinction est progressive</valeur><valeur>cr_lux_05</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:29</date><maj>2008-05-21 10:33:29</maj><valeur>Si dispositif de d&#xE9;tection automatique alors la couverture est totale</valeur><valeur>cr_lux_06</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:29</date><maj>2008-05-21 10:33:29</maj><valeur>L''&#xE9;clairage est automatis&#xE9; lors des entr&#xE9;es dans les pi&#xE8;ces, sas, etc (et doit pouvoir &#xEA;tre d&#xE9;bray&#xE9; en cas de besoin).</valeur><valeur>cr_lux_07</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:29</date><maj>2008-05-21 10:33:29</maj><valeur>Dans une pi&#xE8;ce l''interrupteur est toujours plac&#xE9; &#xE0; c&#xF4;t&#xE9; de la porte d''entr&#xE9;e</valeur><valeur>cr_lux_08</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:30</date><maj>2008-05-21 10:33:30</maj><valeur>Les interrupteurs sont &#xE9;quip&#xE9;s de variateurs</valeur><valeur>cr_lux_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:30</date><maj>2008-05-21 10:33:30</maj><valeur>La disposition des &#xE9;clairages est con&#xE7;ue comme un guide, une aide &#xE0; l''orientation</valeur><valeur>cr_lux_10</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:30</date><maj>2008-05-21 10:33:30</maj><valeur>L''&#xE9;clairage artificiel des espaces int&#xE9;rieurs est &gt;= &#xE0; 100 lux</valeur><valeur>cr_lux_11</valeur><valeur>124</valeur></donnee></donnees></article><article id="1807" idRub="4571">cr_lux_01 21/05/08 - 10:35:02<date>2008-05-21 10:35:02</date><maj>2008-05-21 10:35:02</maj><auteur>6</auteur><donnees><grille>60</grille><champs><champ>ligne_1</champ><champ>ligne_2</champ><champ>ligne_4</champ><champ>mot_1</champ><champ>mot_2</champ><champ>texte_1</champ><champ>texte_2</champ><champ>ligne_3</champ></champs><donnee><date>2008-05-21 10:35:02</date><maj>2008-05-21 10:35:02</maj><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur>cr_lux_01</valeur></donnee></donnees></article></rubrique><rubrique id="4573" idParent="4570" idAdmin="">Pentes et ressauts<motclef>46</motclef><article id="1804" idRub="4573">Pentes et ressauts<date>2008-05-21 10:33:38</date><maj>2008-05-21 10:33:38</maj><auteur>6</auteur><donnees><grille>59</grille><champs><champ>ligne_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-21 10:33:38</date><maj>2008-05-21 10:33:38</maj><valeur>Sur le cheminement le devers est inf&#xE9;rieur &#xE0; 2%</valeur><valeur>cr_pente_01</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:38</date><maj>2008-05-21 10:33:38</maj><valeur>En cheminement courant, il est souhaitable que la valeur du d&#xE9;vers ne d&#xE9;passe pas 1%</valeur><valeur>cr_pente_02</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:38</date><maj>2008-05-21 10:33:38</maj><valeur>Exceptionnellement, pente comprise entre 5 et 8 % sur une longueur maxi de 200 cm (en cas d''impossibilit&#xE9; technique)</valeur><valeur>cr_pente_04</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:39</date><maj>2008-05-21 10:33:39</maj><valeur>Exceptionnellement, pente comprise entre 8 et 10 % sur une longueur maxi de 50 cm (en cas d''impossibilit&#xE9; technique)</valeur><valeur>cr_pente_05</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:39</date><maj>2008-05-21 10:33:39</maj><valeur>Exceptionnellement, la pente peut atteindre 12 % sur une longueur de 50 cm (en cas d''impossibilit&#xE9; technique)</valeur><valeur>cr_pente_06</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:39</date><maj>2008-05-21 10:33:39</maj><valeur>Si pente &gt;= 4%, alors pr&#xE9;sence d''un palier de repos tous les 10 m</valeur><valeur>cr_pente_07</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:40</date><maj>2008-05-21 10:33:40</maj><valeur>Pr&#xE9;sence d''un palier de repos en haut de chaque plan inclin&#xE9; quelle que soit sa longueur</valeur><valeur>cr_pente_08</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:40</date><maj>2008-05-21 10:33:40</maj><valeur>Pr&#xE9;sence d''un palier de repos en bas de chaque plan inclin&#xE9; quelle que soit sa longueur</valeur><valeur>cr_pente_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:40</date><maj>2008-05-21 10:33:40</maj><valeur>Pente inf&#xE9;rieure ou &#xE9;gale 5 %</valeur><valeur>cr_pente_03</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:41</date><maj>2008-05-21 10:33:41</maj><valeur>Pr&#xE9;sence d''un palier de repos tous les 10 m d&#xE8;s qu''une pente sup&#xE9;rieure &#xE0; 2% est am&#xE9;nag&#xE9;e sur une longue distance</valeur><valeur>cr_pente_10</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:41</date><maj>2008-05-21 10:33:41</maj><valeur>Pr&#xE9;sence d''un palier de repos &#xE0; chaque changement de direction sup&#xE9;rieurs &#xE0; 45&#xB0; en cas de cheminement en pente</valeur><valeur>cr_pente_11</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:41</date><maj>2008-05-21 10:33:41</maj><valeur>Les paliers de repos sont horizontaux</valeur><valeur>cr_pente_12</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:42</date><maj>2008-05-21 10:33:42</maj><valeur>Paliers de repos horizontaux ont une longueur minimale de 140 cm</valeur><valeur>cr_pente_13</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:42</date><maj>2008-05-21 10:33:42</maj><valeur>Paliers de repos horizontaux et rectangulaires de dimension minimale de 120 cm sur 140 cm</valeur><valeur>cr_pente_14</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:42</date><maj>2008-05-21 10:33:42</maj><valeur>Si un ressaut ne peut pas &#xEA;tre &#xE9;vit&#xE9; alors ce dernier est arrondi ou muni de chanfrein</valeur><valeur>cr_pente_15</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:43</date><maj>2008-05-21 10:33:43</maj><valeur>Le ressaut a une hauteur maximale de 2 cm</valeur><valeur>cr_pente_16</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:43</date><maj>2008-05-21 10:33:43</maj><valeur>Le ressaut peut atteindre 4 cm, lorsqu''il est am&#xE9;nag&#xE9; en chanfrein &#xE0; 1 /3</valeur><valeur>cr_pente_17</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:43</date><maj>2008-05-21 10:33:43</maj><valeur>Marquage des ressauts par un contraste visuel par la couleur ou l''&#xE9;clairage</valeur><valeur>cr_pente_18</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:44</date><maj>2008-05-21 10:33:44</maj><valeur>La distance minimale entre 2 ressauts est de 250 cm</valeur><valeur>cr_pente_19</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:44</date><maj>2008-05-21 10:33:44</maj><valeur>Absence de pentes comportant des ressauts successifs (''pas d''&#xE2;ne'')</valeur><valeur>cr_pente_20</valeur><valeur>124</valeur></donnee></donnees></article></rubrique><rubrique id="4574" idParent="4570" idAdmin="">Signal&#xE9;tique<motclef>49</motclef><article id="1805" idRub="4574">Signal&#xE9;tique<date>2008-05-21 10:33:44</date><maj>2008-05-21 10:33:44</maj><auteur>6</auteur><donnees><grille>59</grille><champs><champ>ligne_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-21 10:33:44</date><maj>2008-05-21 10:33:44</maj><valeur>Les informations sont regroup&#xE9;es</valeur><valeur>cr_sign_01</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:45</date><maj>2008-05-21 10:33:45</maj><valeur>Le support de l''information est contrast&#xE9;</valeur><valeur>cr_sign_02</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:45</date><maj>2008-05-21 10:33:45</maj><valeur>Le support permet une vision et une lecture en position ''assis''</valeur><valeur>cr_sign_03</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:45</date><maj>2008-05-21 10:33:45</maj><valeur>Le support permet une vision et une lecture en position ''debout''</valeur><valeur>cr_sign_04</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:46</date><maj>2008-05-21 10:33:46</maj><valeur>Le support de l''information ne pr&#xE9;sente pas de reflet ou de contre-jour li&#xE9; &#xE0; sa nature</valeur><valeur>cr_sign_05</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:46</date><maj>2008-05-21 10:33:46</maj><valeur>Le support de l''information ne pr&#xE9;sente pas de reflet ou de contre-jour li&#xE9; &#xE0; sa position</valeur><valeur>cr_sign_06</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:46</date><maj>2008-05-21 10:33:46</maj><valeur>Le support de l''information ne pr&#xE9;sente pas de reflet ou de contre-jour li&#xE9; &#xE0; son orientation</valeur><valeur>cr_sign_07</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:47</date><maj>2008-05-21 10:33:47</maj><valeur>Le support d''information est situ&#xE9; &#xE0; une hauteur inf&#xE9;rieure &#xE0; 220 cm</valeur><valeur>cr_sign_08</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:47</date><maj>2008-05-21 10:33:47</maj><valeur>Si le support d''information est situ&#xE9; &#xE0; une hauteur inf&#xE9;rieure &#xE0; 220 cm, une personne peut s''approcher &#xE0; moins de 1 m&#xE8;tre</valeur><valeur>cr_sign_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:47</date><maj>2008-05-21 10:33:47</maj><valeur>Le support d''information est situ&#xE9; &#xE0; une hauteur comprise entre 90 et 130 cm</valeur><valeur>cr_sign_10</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:48</date><maj>2008-05-21 10:33:48</maj><valeur>La forme du support est une information en soi</valeur><valeur>cr_sign_11</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:48</date><maj>2008-05-21 10:33:48</maj><valeur>La signal&#xE9;tique est visible</valeur><valeur>cr_sign_12</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:48</date><maj>2008-05-21 10:33:48</maj><valeur>Les informations sur le support sont-elles fortement contrast&#xE9;es</valeur><valeur>cr_sign_13</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:49</date><maj>2008-05-21 10:33:49</maj><valeur>La hauteur des caract&#xE8;res d''&#xE9;criture est-elle proportionn&#xE9;e aux circonstances (elle d&#xE9;pend notamment de l''importance de l''information d&#xE9;livr&#xE9;e, des dimensions du local et de la distance de lecture de r&#xE9;f&#xE9;rence fix&#xE9;e par le ma&#xEE;tre d''ouvrage en fonction de ces &#xE9;l&#xE9;ments)</valeur><valeur>cr_sign_14</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:49</date><maj>2008-05-21 10:33:49</maj><valeur>Dans la mesure o&#xF9; les informations sur le support sont des &#xE9;l&#xE9;ments de signalisation et d''informations relatifs &#xE0; l''orientation, les caract&#xE8;res &#xE9;crits ont une hauteur &gt; &#xE0; 1,5 cm</valeur><valeur>cr_sign_15</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:49</date><maj>2008-05-21 10:33:49</maj><valeur>Sinon, les caract&#xE8;res &#xE9;crits ont une hauteur &gt; &#xE0; 0,45 cm</valeur><valeur>cr_sign_16</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:50</date><maj>2008-05-21 10:33:50</maj><valeur>Les caract&#xE8;res sont en reliefs</valeur><valeur>cr_sign_17</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:50</date><maj>2008-05-21 10:33:50</maj><valeur>Il existe une version &#xE9;crite en braille des informations</valeur><valeur>cr_sign_18</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:50</date><maj>2008-05-21 10:33:50</maj><valeur>La signal&#xE9;tique est lisible</valeur><valeur>cr_sign_19</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:51</date><maj>2008-05-21 10:33:51</maj><valeur>La signalisation pr&#xE9;sente t-elle des ic&#xF4;nes ou des pictogrammes ?</valeur><valeur>cr_sign_20</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:51</date><maj>2008-05-21 10:33:51</maj><valeur>Les ic&#xF4;nes ou pictogrammes sont-ils normalis&#xE9;s ?</valeur><valeur>cr_sign_21</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:51</date><maj>2008-05-21 10:33:51</maj><valeur>Dans le cas d''une information sonore, le niveau sonore est-il r&#xE9;glable</valeur><valeur>cr_sign_22</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:51</date><maj>2008-05-21 10:33:51</maj><valeur>Dans le cas d''une annonce sonore &#xE0; caract&#xE8;re g&#xE9;n&#xE9;rale, celle-ci est-elle pr&#xE9;c&#xE9;d&#xE9;e par un ''jingle''</valeur><valeur>cr_sign_23</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:52</date><maj>2008-05-21 10:33:52</maj><valeur>La signal&#xE9;tique est compr&#xE9;hensible</valeur><valeur>cr_sign_24</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:53</date><maj>2008-05-21 10:33:53</maj><valeur>Identification des fonctions dans le b&#xE2;timent par un syst&#xE8;me de couleur (exemple : administration en rouge, et renseignements en vert)</valeur><valeur>cr_sign_25</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:53</date><maj>2008-05-21 10:33:53</maj><valeur>Les pi&#xE8;ces sont identifi&#xE9;es avec des &#xE9;tiquettes pr&#xE9;sentant des informations en relief et contrast&#xE9;es toujours plac&#xE9;es au m&#xEA;me endroit (dans un b&#xE2;timent)</valeur><valeur>cr_sign_26</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:54</date><maj>2008-05-21 10:33:54</maj><valeur>S''il existe un point d''affichage instantann&#xE9; toutes les informations sonores y sont report&#xE9;es (visuellement)</valeur><valeur>cr_sign_27</valeur><valeur>124</valeur></donnee></donnees></article></rubrique><rubrique id="4575" idParent="4570" idAdmin="">Sols, murs et plafonds<motclef>50</motclef><article id="1806" idRub="4575">Sols, murs et plafonds<date>2008-05-21 10:33:54</date><maj>2008-05-21 10:33:54</maj><auteur>6</auteur><donnees><grille>59</grille><champs><champ>ligne_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-21 10:33:54</date><maj>2008-05-21 10:33:54</maj><valeur>Le sol ou le rev&#xEA;tement est non meuble</valeur><valeur>cr_sol_01</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:55</date><maj>2008-05-21 10:33:55</maj><valeur>Le sol ou le rev&#xEA;tement est non glissant</valeur><valeur>cr_sol_02</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:55</date><maj>2008-05-21 10:33:55</maj><valeur>Le sol ou le rev&#xEA;tement est non r&#xE9;fl&#xE9;chissant</valeur><valeur>cr_sol_03</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:55</date><maj>2008-05-21 10:33:55</maj><valeur>Le sol ou le rev&#xEA;tement est sans obstacle &#xE0; la roue</valeur><valeur>cr_sol_04</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-21 10:33:56</date><maj>2008-05-21 10:33:56</maj></donnee></donnees></article></rubrique></rubrique></rubrique></rubrique></rubrique></rubrique></rubrique></documents>\n', '2008-05-21 10:39:33'),
(94, 6, '<?xml version="1.0"?>\n<documents><rubrique id="4561" idParent="4560" idAdmin="6">Commune Test<motclef>59</motclef><article id="1789" idRub="4561">Commune Test<date>2008-05-14 17:43:27</date><maj>2008-05-14 17:47:39</maj><auteur/><donnees><grille>66</grille><champs><champ>mot_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-14 17:43:27</date><maj>2008-05-14 17:43:27</maj><valeur/><valeur>Commune Test</valeur><valeur>59</valeur></donnee></donnees></article></rubrique></documents>\n', '2008-05-21 10:52:47'),
(95, 6, '<?xml version="1.0"?>\n<documents><rubrique id="4561" idParent="4560" idAdmin="6">Commune Test<motclef>59</motclef><article id="1789" idRub="4561">Commune Test<date>2008-05-14 17:43:27</date><maj>2008-05-14 17:47:39</maj><auteur/><donnees><grille>66</grille><champs><champ>mot_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-14 17:43:27</date><maj>2008-05-14 17:43:27</maj><valeur/><valeur>Commune Test</valeur><valeur>59</valeur></donnee></donnees></article></rubrique></documents>\n', '2008-05-21 10:57:30');
INSERT INTO `spip_synchro_historique` (`id_synchro`, `id_auteur`, `synchro_xml`, `maj`) VALUES 
(96, 6, '<?xml version="1.0"?>\n<documents><rubrique id="1058" idParent="" idAdmin="6"><motclef/><rubrique id="4508" idParent="" idAdmin="">Cheminement sur la voirie 6/05/08 - 10:15:22<motclef>130</motclef><article id="1736" idRub="4508">Cheminement sur la voirie 6/05/08 - 10:15:22<date>2008-05-06 10:15:22</date><maj>2008-05-21 10:57:22</maj><auteur>6</auteur><donnees><grille>59</grille><champs><champ>ligne_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-06 10:15:22</date><maj>2008-05-06 10:15:22</maj><valeur>Le sol n''est pas meuble</valeur><valeur>cr_voirie_chem_01</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:22</date><maj>2008-05-06 10:15:22</maj><valeur>Le rev&#xEA;tement n''est pas glissant</valeur><valeur>cr_voirie_chem_02</valeur><valeur>141</valeur></donnee><donnee><date>2008-05-06 10:15:22</date><maj>2008-05-06 10:15:22</maj><valeur>Le cheminement ne comporte pas d''obstacles au sol</valeur><valeur>cr_voirie_chem_03</valeur><valeur>1</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>S''il existe sur le cheminement des obstacles en porte-&#xE0;-faux alors ils laissent un passage libre &gt;= 220 cm de haut</valeur><valeur>cr_voirie_chem_04</valeur><valeur>2</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>S''il existe sur le cheminement des obstacles en saillie lat&#xE9;rale de plus de 15 cm laissant un passage libre inf &#xE0; 220 cm de hauteur, alors ils sont rappel&#xE9;s par un &#xE9;l&#xE9;ment bas install&#xE9; au max &#xE0; 40 cm du sol ou par une sur&#xE9;paisseur au sol d''au moins 3 cm</valeur><valeur>cr_voirie_chem_05</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Pr&#xE9;sence d''un guide tactilement et visuellement constrat&#xE9; le long du cheminement</valeur><valeur>cr_voirie_chem_06</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>La largeur du cheminement est &gt;= &#xE0; 140 cm sans obstacle</valeur><valeur>cr_voirie_chem_07</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si absence de murs et d''obstacles de part et d''autre du cheminement alors sa largeur est &gt;= &#xE0; 120 cm</valeur><valeur>cr_voirie_chem_08</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Le devers est inf&#xE9;rieur ou &#xE9;gal &#xE0; 2%</valeur><valeur>cr_voirie_chem_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Pente inf&#xE9;rieure &#xE0; 5%</valeur><valeur>cr_voirie_chem_10</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si impossibilit&#xE9; technique alors pente inf&#xE9;rieure &#xE0; 8% sur une distance inf&#xE9;rieure ou &#xE9;gale &#xE0; 2 m</valeur><valeur>cr_voirie_chem_11</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si impossibilit&#xE9; technique alors pente inf&#xE9;rieure &#xE0; 12% sur une distance inf&#xE9;rieure ou &#xE9;gale &#xE0; 50 cm</valeur><valeur>cr_voirie_chem_12</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si pente sup&#xE9;rieure &#xE0; 4% alors palier de repos en bas</valeur><valeur>cr_voirie_chem_13</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si pente sup&#xE9;rieure &#xE0; 4% alors palier de repos en haut</valeur><valeur>cr_voirie_chem_14</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si cheminement pentu continu alors palier de repos tous les 10 m</valeur><valeur>cr_voirie_chem_15</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si cheminement pentu continu alors pr&#xE9;sence d''un main courante ergonomique et constrat&#xE9;e</valeur><valeur>cr_voirie_chem_16</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Le palier est horizontal</valeur><valeur>cr_voirie_chem_17</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Le palier mesure 120 x 140 cm sans obstacle</valeur><valeur>cr_voirie_chem_18</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Un palier de repos pr&#xE9;sent &#xE0; chaque bifurcation du cheminement</valeur><valeur>cr_voirie_chem_19</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Un palier de repos pr&#xE9;sent &#xE0; chaque bifurcation du cheminement poss&#xE8;de un espace de manoeuvre de 200 cm de diam&#xE8;tre</valeur><valeur>cr_voirie_chem_20</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si rupture de niveau de plus de 40 cm alors garde-corps le long de la rupture de niveau</valeur><valeur>cr_voirie_chem_21</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Le garde au corps est contrast&#xE9; par rapport &#xE0; l''environnement, plein et continu jusqu''au sol</valeur><valeur>cr_voirie_chem_22</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Un ressaut est inf&#xE9;rieure ou &#xE9;gal &#xE0; 2 cm</valeur><valeur>cr_voirie_chem_23</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Un ressaut est inf&#xE9;rieur ou &#xE9;gal &#xE0; 4 cm si il e